import React from 'react';
import Logo from '../../../utils/img/rsz_logo.jpg';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
	whiteBG: {
		backgroundColor: '#FFF',
	},
	gridPadding: {
		padding: '10px 0',
	},
	message: {
		marginRight: 20,
		color: '#154d69',
		fontSize: '1.2em',
		textAlign: 'right',
	},
	signUpBtn: {
		color: '#154d69',
	},
	signInBtn: {
		marginRight: 3,
		color: '#154d69',
	},
	toolbarSecondary: {
		overflowX: 'auto',
		padding: 0,
		justifyContent: 'space-between',
	},
});

const Navbar = () => {
	const classes = useStyles();

	return (
		<Grid container className={classes.whiteBG}>
			<Container>
				{/* <Grid
					item
					container
					direction='row-reverse'
					justify='space-between'
					alignItems='center'
					className={classes.gridPadding}
				>
					<Grid item xs={7} md={6} container direction='row-reverse' alignItems='center'>
						<img src={Logo} alt='Logo' className='logo' />
						<Grid item xs={7} container direction='column' className={classes.message}>
							<Grid item>جلب رضایت شما</Grid>
							<Grid item>اولین اولویت ماست</Grid>
						</Grid>
					</Grid>
					<Grid item xs={5} md={6}>
						<Button variant='outlined' color='primary' className={classes.signUpBtn}>
							عضویت
						</Button>
						<Button className={classes.signInBtn}>ورود</Button>
					</Grid>
				</Grid> */}
				<Toolbar component='nav' variant='dense' className={classes.toolbarSecondary}>
					<Grid item className='border'>
						<img src={Logo} alt='Logo' className='logo' />
						<Grid item>
							<Typography display='inline'>جلب رضایت شما</Typography>
							<br />
							<Typography display='inline'>اولین اولویت ماست</Typography>
						</Grid>
					</Grid>
					<Grid item>
						<Button variant='outlined' color='primary' className={classes.signUpBtn}>
							عضویت
						</Button>
						<Button className={classes.signInBtn}>ورود</Button>
					</Grid>
				</Toolbar>
			</Container>
		</Grid>
	);
};

export default Navbar;
